<!DOCTYPE html>
<html style="background-color: #F6F5F4">

<head>
    <title>ManualVersions</title>
    <link rel="stylesheet" type="text/css" href="../css/materialdesignicons.min.css" />
    <link rel="stylesheet" href="https://fonts.googleapis.com/css?family=Roboto:300,400,500,700" type="text/css">
    <link rel="stylesheet" type="text/css" href="../css/material-components-web.min.css" />
    <link rel="stylesheet" type="text/css" href="../css/uf-styles.css" />
</head>
<script>
    window.addEventListener("message", receiveMessage, false);
    function receiveMessage(event) {
        document.getElementById('uf_content').innerHTML = (event.data);
    }
</script>

<body class="mdc-typography mdc-theme--background">
    <div class="uf-layout">
        <div class="mdc-layout-grid uf-content-wrapper">
            <div class="mdc-layout-grid__inner">
                <div id="body_content" class="uf-content-wrapper mdc-layout-grid__cell--span-6-desktop mdc-layout-grid__cell--span-4-tablet mdc-layout-grid__cell--span-4-phone">
                    <div class="uf-content" id="uf_content">
                    </div>
                </div>
            </div>
        </div>
    </div>
</body>
</body>

</html>
